// execute a lua string and handle errors correctly
void LuaSystem::RunString(std::string str) {
	bool bErrorCaused = luaL_dostring(L, str.c_str());

	if (bErrorCaused) {
		CONSOLE->AddToBuffer(lua_tostring(L, -1));
	}
}

